Студия развивающего обучения "Облако" приглашает детей с 3 лет. 

 Дисциплины дошкольного возраста: 
* развитие речи; 
* развитие актерских и музыкальных способностей;
* математика и естествознание; 
* грамота и детская литература; 
* английский язык; 
* вокальный класс; 
* ритмика; 
* постановка концертных номеров.  

Дисциплины школьного возраста:
- сценическая речь; 
- эстрадный вокал; 
- подиумный шаг; 
- современный эстрадный танец "MTV-dance" и "ХИП-ХОП"; 
- постановка концертных номеров; 
- теория музыки; 
- мировая художественная культура; 
- английский язык.

*************************************

ШКОЛА СОВЕРШЕНСТВА ДЛЯ ВЗРОСЛЫХ приглашает мужчин и женщин, юношей и девушек не моложе 14 лет.  
Курс ШКОЛЫ СОВЕРШЕНСТВА рассчитан на 2 года (без летних месяцев).  
В ПРОГРАММЕ КОМПЛЕКСНОГО ОБУЧЕНИЯ: 
- Этикет; 
- Фитнес; 
- Хореография; 
- Подиумный шаг; 
- Английский язык; 
- Мировая Художественная Культура;
 - Диетология; - Мода и стиль; 
- Искусство макияжа и прически; 
- Навыки сценической речи и актерского мастерства.  

тел. 8-902-87-14-007 Любовь Петровна
